    good_permutations_count = 1
    b = [i for i in range(1, N + 1)]
    for i in a:
        if i != 0:
            b.remove(i)
    d = list(permutations(b))
    for j in d:
        s = 0
        t = []
        for i in range(len(a)):
            if a[i] == 0:
                t.append(j[s])
                s += 1
            else:
                t.append(a[i])
        h = 0
        for i in range(0, N - 1):
            if t[i] < t[i + 1]:
                h += 1
        if h == K:
            good_permutations_count += 1
    return good_permutations_count

